import React, { useState, useEffect } from "react";
import "./Admin.css";
import { Navbar } from "../index";
import axios from "axios";

function Admin() {
  const [parcels, setParcels] = useState([]);
  const [editIndex, setEditIndex] = useState(-1); // Track which parcel is being edited
  const [editedParcel, setEditedParcel] = useState({
    parcel_ID: "",
    weight: "",
    type: "",
    shipping_cost: "",
    parcel_sender: "",
    parcel_receiver: "",
    parcel_branch: "",
  });

  useEffect(() => {
    axios
      .get("http://localhost:3333/Admin")
      .then((res) => {
        setParcels(res.data);
      })
      .catch((err) => console.log(err));
  }, []);

  const handleEdit = (index) => {
    setEditIndex(index);
    const parcelToEdit = parcels[index];
    setEditedParcel(parcelToEdit);
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setEditedParcel((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleSave = () => {
    // Update database with edited parcel data
    axios
      .post(`http://localhost:3333/Admin/${editedParcel.parcel_ID}`, editedParcel)
      .then((res) => {
        // Handle success, maybe refresh parcel list or update specific parcel
        console.log("Parcel updated successfully");
        setEditIndex(-1); // Reset edit index
      })
      .catch((err) => console.log(err));
  };

  return (
    <>
    <Navbar/>
    <div>

      <div>
        <div className="Admin-Container">
          <div className="Admin-table-container">
            <button className="btn btn-success">Add +</button>
            <table className="table">
              <thead>
                <tr>
                  <th>Parcel ID</th>
                  <th>Weight</th>
                  <th>Type</th>
                  <th>Shipping Cost</th>
                  <th>Sender</th>
                  <th>Receiver</th>
                  <th>Branch</th>
                  <th>Actions</th>
                </tr>
              </thead>
              <tbody>
                {parcels.map((parcel, index) => (
                  <tr key={parcel.parcel_ID}>
                    <td>{parcel.parcel_ID}</td>
                    <td>
                      {editIndex === index ? (
                        <input
                          type="text"
                          name="weight"
                          value={editedParcel.weight}
                          onChange={handleChange}
                        />
                      ) : (
                        parcel.weight
                      )}
                    </td>
                    <td>{parcel.type}</td>
                    <td>{parcel.shipping_cost}</td>
                    <td>{parcel.parcel_sender}</td>
                    <td>{parcel.parcel_receiver}</td>
                    <td>{parcel.parcel_branch}</td>
                    <td>
                      {editIndex === index ? (
                        <button onClick={handleSave}>Save</button>
                      ) : (
                        <button onClick={() => handleEdit(index)}>Edit</button>
                      )}
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </div>
    </>
  );
}

export default Admin;
